import api from "./baseApi";

export const notificationApi = {
  getNotifications(params, cancelToken) {
    return api.get("/api/admin/notification", { params, cancelToken });
  },
  getNotificationRep(params) {
    return api.get(`/api/notification/rep`, { params });
  },
  getNotificationChatList(params) {
    return api.get(`/api/notification/rep/list-chat`, { params });
  },
  editNotification(params, id) {
    return api.put(`api/check-point/${id}`, params);
  },
  sendNewReply(params) {
    return api.post(`/api/notification/rep`, params);
  },
  deleteNotification(params) {
    return api.delete(`/api/check-point/${params.id}`);
  },
  createNotification(params) {
    return api.post("/api/admin/notification", params);
  },
};
